import { useState } from "react";
import Calendar from "../Components/Calendar";

const Dashboard = () => {
  const [user, setUser] = useState({
    firstname: "Julia",
    lastname: "Pasquier",
    email: "pasquierjulia5@gmail.com",
    phone: "0470/78.38.42",
    address: "Rue la rue 5, 1000 Bruxelles, Belgique",
  });

  const handleChange = (e) => {
    setUser({ ...user, [e.target.name]: e.target.value });
  };

  return (

    
    <div className="container mx-auto grid grid-cols-2 gap-11 p-11 mt-11">
      <div>
        <h1 className="text-2xl font-bold mb-4 p-9">
          Welcome {user.firstname} to your profile
        </h1>
        <ul className="list-disc pl-4 list-none ">
          <li>
            __Firstname: {user.firstname}
          </li>
          <li>
            ___Lastname: {user.lastname}
          </li>
          <li>
            ____Email: {user.email}
          </li>
          <li>
            _____Phone: {user.phone}
          </li>
          <li>
            ____Address: {user.address}
          </li>
        </ul>
      </div>
      <Calendar />
    </div>
  );
};

export default Dashboard;
